INSERT INTO `tb_feeding` (`id_feeding`, `id_title`, `title`, `Content`) VALUES
(1, 1, 'การเลี้ยงทารกปากแหว่งเพดานโหว่ด้วยน้ำนมแม่', 'ทารกปากแหว่งเพดานโหว่มักจะประสบกับปัญหาในการให้นม จึงส่งผลกระทบต่อภาวะโภชนาการตั้งแต่แรกคลอด   ปัญหาการดูดการกลืนเป็นปัญหาแรกที่ต้องได้รับการแก้ไข   ปัญหาต่าง ๆ ทั้งหมดสามารถแก้ไขได้ ถ้าหากแม่เรียนรู้วิธีการให้นมถูกวิธี  การให้ทารกที่มีภาวะปากแหว่งเพดานโหว่ดูดนมแม่จากเต้าแม่เป็นทางเลือกที่ดีที่สุด เพราะจะช่วยป้องกันปัญหาต่างๆ ดังกล่าวมาแล้วข้างต้นได้ เนื้อของเต้านมแม่ยืดหยุ่นง่ายสามารถปรับรูปร่างไปปิดช่องรอยแหว่งและรอยโหว่ได้มากกว่าหัวนมยาง ทำให้ทารกสามารถอมหัวนมแม่ได้แนบสนิทกว่าและเป็นไปได้มากกว่าหัวนมชนิดอื่นๆ จึงทำให้ลมมีโอกาสเข้าไปในช่องท้องได้น้อยกว่าวิธีอื่น'),
(3, 2, 'ประโยชน์ของนมแม่ต่อทารกที่มีปัญหาปากแหว่งเพดานโหว่', 'นมแม่มีคุณสมบัติพิเศษหลายอย่าง ได้แก่ โภชนาการสูงสุดสำหรับทารก มีภูมิต้านทานต่อโรคต่างๆที่ได้รับจากมารดา ป้องกันภาวะหูน้ำหนวก  การดูดนมแม่นอกจากมีผลดีต่อเรื่องคุณค่าอาหารที่ครบถ้วนและประหยัดค่าใช้จ่ายแล้วยังมีผลดีต่อการพัฒนาการทำงานของอวัยวะในช่องปาก และพฤติกรรมการดูดกลืนหลายอย่างพอสรุปได้พอสังเขปดังนี้\r\n1. ภูมิต้านทานสูง น้ำนมแม่มีสารที่ป้องกันการเกิดการอักเสบ  และการติดเชื้อโรคต่างๆ การเลี้ยงทารกด้วยนมแม่จะช่วยลดปัญหาการติดเชื้อในหูชั้นกลาง ลดปัญหาการอักเสบในโพรงจมูก และทางเดินหายใจ  ดังได้กล่าวไว้แล้วว่าทารกที่มีช่องปากที่เปิดถึงโพรงจมูก มีโอกาสเกิดการอักเสบในโพรงจมูกได้ง่าย เนื่องจากการการระคายเคืองจากนมและน้ำที่ไหลย้อนขึ้นไปขณะกลืนอาหาร ภูมิต้านทานดังกล่าวคงอยู่ยาวนานเท่ากับระยะเวลาที่ทารกยังได้กินนมแม่อยู่\r\n2. การดูดนมแม่จะลดโอกาสการเกิดการสำรอกและไม่เสี่ยงต่อการสำลัก   เนื่องจากนมแม่ย่อยง่ายผ่านกระเพาะอาหารเร็ว  และถ้าใช้จุกนมยางให้ทารกดูดจะกลืนลมเข้าไปมากขณะดูดนม จึงเป็นปัญหาที่ทำให้ทารกเหล่านี้มีปัญหาการสำรอกบ่อย แต่การดูดนมแม่จากเต้า หัวนมแม่และลานนมจะสามารถปรับรูปไปอุดรอยโหว่ได้มากกว่าจุกหัวนมยางที่ปรับสภาพได้ยาก ทำให้การดูดนมแม่จะมีลมเข้าไปในช่องท้องน้อยกว่าการดูดนมจากขวด\r\n3. การดูดนมแม่ส่งเสริมการทำงานของระบบการกลืน และการเคี้ยว การดูดนมแม่ ทารกจะสามารถควบคุมกลไก จังหวะไหล และการกลืนได้อย่างประสานกันได้ด้วยตนเอง การทำงานของระบบการกลืน และการเคี้ยวจึงมีการพัฒนาได้ดี ในทางตรงกันข้ามพบว่าการดูดนมขวดทำให้ขัดขวางขบวนการเจริญเติบโตของกลไกการเคี้ยวและการกลืน\r\n4. การดูดนมแม่ส่งเสริมการเจริญเติบโตและพัฒนาการของสมอง  น้ำนมแม่มีฮอร์โมนจำนวนมากและมีสารกระตุ้นการเจริญเติบโต    ซึ่งมีผลต่อการเจริญเติบโตของระบบภูมิคุ้มกันในทารก   ระบบประสาทและระบบต่อมไร้ท่อ   ฮอร์โมนบางตัวทำหน้าที่กระตุ้นการเจริญเติบโตคล้ายฮอร์โมนกระตุ้นการเจริญเติบโต และมีโครงสร้างของไซโตคิน ซึ่งมีอยู่ในสมองของคนจำนวนมาก(   และกระตุ้นการทำงานของระบบประสาท ทำให้ทารกที่กินนมแม่มีพัฒนาการทางด้านความจำดีกว่าทารกที่กินนมผสม  น้ำนมแม่มีน้ำนมแม่มีกรดไขมันไม่อิ่มตัวที่เรียกว่าโดโคซาเฮคซาโนอิค (docosahexanoic:DHA) และ กรดอะราดชิโดนิก (arachidonic acid: AA) ที่มีส่วนสำคัญต่อการเจริญเติบโตและพัฒนาของเยื่อหุ้มเซลล์ของสมองทารก)');
