elvetica, sans-serif; font-size: small; ">&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">เธเธฒเธฃเธชเธฃเนเธฒเธเธฃเธฐเธเธเธเธฒเธฃเธเธฃเธดเธเธฒเธฃเธเธตเนเนเธซเธกเธฒเธฐเธชเธกเธเธตเนเธชเธธเธเธชเธณเธซเธฃเธฑเธเธเธนเนเธเนเธงเธขเธเธตเนเธกเธตเธ�เธฒเธงเธฐเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเนเนเธฅเธฐเธเธงเธฒเธกเธเธดเธเธฒเธฃเนเธเนเธเธณเนเธเธดเธเธเธญเธเธจเธตเธฃเธฉเธฐเนเธฅเธฐเนเธเธซเธเนเธฒเนเธเธขเธเธฒเธฃเนเธซเนเธเธฒเธฃเธจเธถเธเธฉเธฒเธเธถเธเธญเธเธฃเธกเนเธเน เธเธธเธเธฅเธฒเธเธฃเธเธฒเธเธเธฒเธฃเนเธเธเธขเน&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">เธเธฒเธฃเธงเธดเธเธฑเธขเนเธฅเธฐเธชเนเธเนเธชเธฃเธดเธกเธเธฒเธฃเธเธนเนเธฅเนเธเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃ เนเธฅเธฐเธเธงเธฒเธกเธฃเนเธงเธกเธกเธทเธญเธชเธซเธชเธเธฒเธเธฑเธ เธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธฃเธเธฐเธกเธธเนเธเนเธเนเธเธเธฒเธฃเธเธนเนเธฅเนเธเธเธญเธเธเนเธฃเธงเธก เนเธเธขเธกเธตเธเธฒเธฃเธญเธญเธเนเธเธเธเธฒเธเนเธซเนเนเธซเธกเธฒเธฐเธชเธกเธเธฑเธเธงเธฑเธเธเธเธฃเธฃเธกเธเนเธญเธเธเธดเนเธเธเธฑเธเธเธธเธเธฑเธเธชเธ�เธฒเธงเธฐเธเธฒเธเธชเธฑเธเธเธกเนเธฅเธฐเนเธจเธฃเธฉเธเธจเธฒเธชเธเธฃเน เนเธฅเธฐเธเนเธขเธเธฒเธขเธเนเธฒเธเธชเธธเธเธ�เธฒเธ&nbsp;</span></p>\r\n<p>\r\n	<u><strong><span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">เธงเธฑเธเธเธธเธเธฃเธฐเธชเธเธเน</span></strong></u><br style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; " />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">1. เนเธเนเธเธจเธนเธเธขเนเธเธฅเธฒเธเธเธฒเธฃเธเธฃเธฐเธชเธฒเธเธเธฒเธเธเธญเธเธเธธเธเธฅเธฒเธเธฃเธเธญเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเนเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเน เนเธฅเธฐเธเธงเธฒเธกเธเธดเธเธฒเธฃเธฒเธฒเนเธเนเธเธณเนเธเธดเธ เธเธญเธเธจเธตเธฃเธฉเธฐเนเธฅเธฐเนเธเธซเธเนเธฒ เธเธญเธเธกเธซเธฒเธงเธดเธเธขเธฒเธฅเธฑเธขเธเธญเธเนเธเนเธ&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">2. เนเธเนเธเธจเธนเธเธขเนเธเธฅเธฒเธเธเธญเธเธเธฒเธฃเธเธฃเธฐเธชเธฒเธเธเธฒเธเนเธเธทเนเธญเธเธฒเธฃเธเธฑเธเธเธฒเธฃเธฐเธเธเธเธตเนเธกเธตเธเธงเธฒเธกเนเธซเธกเธฒเธฐเธชเธกเนเธฅเธฐเธกเธฒเธเธฃเธเธฒเธเธเธญเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเน เนเธฅเธฐเธเธงเธฒเธกเธเธดเธเธฒเธฃเนเธเนเธเธณเนเธเธดเธ เธเธญเธเธจเธตเธฃเธฉเธฐเนเธฅเธฐเนเธเธซเธเนเธฒ เนเธเธขเธกเธธเนเธเนเธเนเธเธเธนเนเธเนเธงเธข/เธเธฃเธญเธเธเธฃเธฑเธงเนเธเนเธเธจเธนเธเธขเนเธเธฅเธฒเธเธเธฒเธฃเธเธนเนเธฅเนเธเธเธญเธเธเนเธฃเธงเธกเนเธฅเธฐเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃ&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">3. เนเธเธทเนเธญเธเธฒเธฃเธเธณเนเธชเธเธญเนเธฅเธเนเธเธฅเธตเนเธขเธเธเธงเธฒเธกเธฃเธนเน เธเธฒเธฃเธเธฑเธเธเธฒเธฃเธจเธถเธเธฉเธฒ/เธเธถเธเธญเธเธฃเธก เธเธฅเธดเธเนเธญเธเธชเธฒเธฃเธเธฒเธเธงเธดเธเธฒเธเธฒเธฃ เนเธฅเธฐเนเธเนเธเนเธซเธฅเนเธเธเธงเธฒเธกเธฃเธนเนเนเธเนเธเธธเธเธฅเธฒเธเธฃเธเธฒเธเธเธฒเธฃเนเธเธเธขเน เธเธฑเธเธจเธถเธเธฉเธฒ เธเธนเนเธเนเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธง เนเธฅเธฐเธเธนเนเธเธตเนเธชเธเนเธ/เธญเธเธเนเธเธฃเธญเธทเนเธเน&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">4. เธเธฒเธฃเธเธณเธงเธดเธเธฑเธขเธเธตเนเนเธเธตเนเธขเธงเธเนเธญเธ เนเธเธทเนเธญเธเธณเธเธฅเธเธฒเธเธเธตเนเธจเธถเธเธฉเธฒเธงเธดเธเธฑเธขเธกเธฒเธชเธฃเนเธฒเธเธญเธเธเนเธเธงเธฒเธกเธฃเธนเนเนเธฅเธฐเธเธตเนเธเธณเธชเธฑเธเธเธก เนเธฅเธฐเธฅเธเธเธฑเธเธเธฑเธขเธเธฒเธฃเนเธเธดเธเธ�เธฒเธงเธฐเธเธงเธฒเธกเธเธดเธเธฒเธฃเนเธเนเธเธณเนเธเธดเธ&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">5. เธชเนเธเนเธชเธฃเธดเธกเธเธฒเธฃเธเธณเธเธฒเธเนเธเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเนเธฅเธฐเธเธงเธฒเธกเธฃเนเธงเธกเธกเธทเธญเนเธเธเธชเธซเธชเธเธฒเธเธฑเธ เธเธฑเนเธเนเธเธฃเธฐเธเธฑเธเธเธฃเธฐเนเธเธจเนเธฅเธฐเธฃเธฐเธเธฑเธเธเธฒเธเธฒเธเธฒเธเธด&nbsp;</span></p>\r\n<p>\r\n	<u><strong><span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">เธเธฅเธธเนเธกเธเธฃเธฐเธเธฒเธเธฃเนเธเนเธฒเธซเธกเธฒเธข&nbsp;</span></strong></u><br style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; " />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">1. เธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเนเนเธฅเธฐเธเธงเธฒเธกเธเธดเธเธฒเธฃเนเธเนเธเธณเนเธเธดเธเธเธญเธเธจเธตเธฃเธฉเธฐเนเธฅเธฐเนเธเธซเธเนเธฒเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธงเธเธตเนเธญเธขเธนเนเนเธเธเธฒเธฃเธเธนเนเธฅเนเธเธขเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเธเธญเธ เธกเธซเธฒเธงเธดเธเธขเธฒเธฅเธฑเธขเธเธญเธเนเธเนเธ เนเธฅเธฐเธเธญเธเธซเธเนเธงเธขเธเธฒเธเธเธตเนเธญเธขเธนเนเนเธเนเธเธฃเธเธเธฒเธฃเธเธงเธฒเธกเธฃเนเธงเธกเธกเธทเธญเนเธเธเธชเธซเธชเธเธฒเธเธฑเธ&nbsp;</span><br style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; " />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">2. เธเธธเธเธฅเธฒเธเธฃเธเธญเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเธเธตเนเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเนเนเธฅเธฐเธเธงเธฒเธกเธเธดเธเธฒเธฃเนเธเนเธเธณเนเธเธดเธเธเธญเธเธจเธตเธฃเธฉเธฐเนเธฅเธฐเนเธเธซเธเนเธฒเธเธตเนเนเธเธตเนเธขเธงเธเนเธญเธเธเธญเธ เธกเธซเธฒเธงเธดเธเธขเธฒเธฅเธฑเธขเธเธญเธเนเธเนเธ เนเธฅเธฐเธเธนเนเธเธตเนเนเธเธตเนเธขเธงเธเนเธญเธ</span><br style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; " />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">3. เธซเธเนเธงเธขเธเธฒเธเนเธฅเธฐเธญเธเธเนเธเธฃเธเธตเนเนเธเธตเนเธขเธงเธเนเธญเธเธ�เธฒเธเธฃเธฑเธเนเธฅเธฐเนเธญเธเธเธ เธเธตเนเธเธฃเธถเธเธฉเธฒเนเธฅเธฐเธเธนเนเนเธซเนเธเธฒเธฃเธชเธเธฑเธเธชเธเธธเธเธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธฃเธเธญเธเธจเธนเธเธขเนเธฏ เธเธฑเนเธเนเธเนเธเธเธเธทเนเธเธเธตเน เธฃเธฐเธเธฑเธเธกเธซเธฒเธงเธดเธเธขเธฒเธฅเธฑเธข เธฃเธฐเธเธฑเธเธเธฃเธฐเนเธเธจ เนเธฅเธฐเธเธฒเธเธฒเธเธฒเธเธด&nbsp;</span><br style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; " />\r\n	<br style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; " />\r\n	<u><strong><span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">เนเธเธงเธเธฒเธเธเธฒเธฃเธเธณเนเธเธดเธเธเธดเธเธเธฃเธฃเธก</span></strong></u><br style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; " />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">1. เนเธเนเธเนเธเธฃเธเธเธฒเธฃเธเธงเธฒเธกเธฃเนเธงเธกเธกเธทเธญเธฃเธฐเธซเธงเนเธฒเธเธเธเธฐเนเธเธเธขเธจเธฒเธชเธเธฃเน เนเธฅเธฐเธเธเธฐเธเธฑเธเธเนเธเธเธขเธจเธฒเธชเธเธฃเน เธเธตเนเนเธเนเธฃเธฑเธเธเธฒเธฃเธชเธเธฑเธเธชเธเธธเธเธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธฃเธเธฒเธ เธกเธซเธฒเธงเธดเธเธขเธฒเธฅเธฑเธขเธเธญเธเนเธเนเธ เนเธฅเธฐเธกเธตเธเธฒเธฃเธซเธฒเนเธซเธฅเนเธเธเธธเธเธชเธเธฑเธเธชเธเธธเธเธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธฃเนเธเธดเนเธกเนเธเธดเธกเนเธเธทเนเธญเนเธซเนเธชเธฒเธกเธฒเธฃเธเธเธณเนเธเธดเธเธเธฒเธฃเนเธเนเธฃเธฐเธขเธฐเธขเธฒเธง&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">2. เธเธฒเธฃเธชเธฃเนเธฒเธเธฃเธฐเธเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเนเธเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃ เนเธเธขเธกเธตเธเธนเนเธเธฃเธฐเธชเธฒเธเธเธฒเธเธชเธฃเนเธฒเธเนเธเธงเธเธฒเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเนเธเธเธญเธเธเนเธฃเธงเธกเธเธตเนเธกเธธเนเธเนเธเนเธเธเธนเนเธเนเธงเธข เนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธงเนเธเนเธเธจเธนเธเธขเนเธเธฅเธฒเธเนเธเธขเธเธตเธกเธชเธซเธงเธดเธขเธฒเธเธฒเธฃเธเธตเนเธกเธตเธเธฒเธฃเธเธนเนเธฅเธญเธขเนเธฒเธเธเนเธญเนเธเธทเนเธญเธเนเธเนเธเธฃเธฐเธขเธฐเธขเธฒเธง เธเธฒเธฃเธเธฑเธเธเธฅเธดเธเธดเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเน เนเธเธเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเธญเธขเนเธฒเธเธชเธกเนเธณเนเธชเธกเธญ เนเธฅเธฐเธกเธตเธเธฒเธฃเธเธฃเธฐเนเธกเธดเธเธเธฅเธเธธเธเธ�เธฒเธเธเธญเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเนเธฒเธเธเนเธฒเธเน เนเธเธทเนเธญเธเธฒเธฃเธเธฑเธเธเธฒเธญเธขเนเธฒเธเธเนเธญเนเธเธทเนเธญเธ&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">3. เธเธฒเธฃเธเธฑเธเธเธฒเธฃเธเธถเธเธญเธเธฃเธก เธเธฃเธฐเธเธธเธกเธงเธดเธเธฒเธเธฒเธฃ เธฃเธงเธกเธเธถเธเธเธฒเธฃเธเธฅเธดเธเนเธญเธเธชเธฒเธฃเธเธฒเธเธงเธดเธเธฒเธเธฒเธฃ เธเธณเธฃเธฒ เนเธฅเธฐเธเธฒเธเธงเธดเธเธฑเธข เนเธเธทเนเธญเนเธเนเธเธเธฒเธฃเนเธซเนเธเธงเธฒเธกเธฃเธนเนเนเธฅเธฐเนเธเธขเนเธเธฃเนเธเธฅเธเธฒเธ เธเธญเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃ เนเธเนเธเธธเธเธฅเธฒเธเธฃเธเธฒเธเธเธฒเธฃเนเธเธเธขเนเนเธฅเธฐเธเธนเนเธเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธงเธญเธขเนเธฒเธเธเนเธญเนเธเธทเนเธญเธ&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">4. เธเธฒเธฃเธงเธดเธเธฑเธข เธเธฑเธเนเธซเนเธกเธตเนเธเธฃเธเธเธฒเธฃเธงเธดเธเธฑเธขเธเธตเนเนเธเธตเนเธขเธงเธเนเธญเธเธเธฑเธเธเธฅเธธเนเธกเธเธนเนเธเนเธงเธขเธเธตเนเนเธเนเธเธเธฑเธเธซเธฒเธเธตเนเธเธฃเธฐเธเธเธเนเธญเธชเธฑเธเธเธก เนเธเนเธเธเธฃเธฐเนเธขเธเธเนเธเนเธญเธเธฒเธฃเธเธฑเธเธเธฒเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเนเธเธญเธเธฒเธเธ เนเธฅเธฐเธชเธฒเธกเธฒเธฃเธเธเธณเนเธเธชเธนเนเธเธฒเธฃเธงเธดเธเธฑเธขเธเธตเนเธกเธตเธกเธฒเธเธฃเธเธฒเธเธฃเธฐเธเธฑเธเธเธฒเธเธฒเธเธฒเธเธด&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">5. เธเธฒเธฃเธเธฃเธดเธเธฒเธฃเธงเธดเธเธฒเธเธฒเธฃเนเธเนเธชเธฑเธเธเธก เนเธเธขเธเธฑเธเนเธซเนเธกเธตเนเธเธฃเธเธเธฒเธฃเธเธฃเธดเธเธฒเธฃเธงเธดเธเธฒเธเธฒเธฃ เนเธซเนเธเธงเธฒเธกเธฃเธนเนเธเนเธฒเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเน เนเธเนเธเธนเนเธเนเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธง เนเธฅเธฐเธเธฑเธเธเธณเนเธญเธเธชเธฒเธฃเธเธนเนเธกเธทเธญเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเน เธชเธณเธซเธฃเธฑเธเธเธนเนเธเนเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธง&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">6. เนเธเนเธเธจเธนเธเธขเนเธเธฅเธฒเธเธเธฒเธฃเธเธฃเธฐเธชเธฒเธเธเธฒเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเน เธเธฑเนเธเนเธเนเธเธเธ�เธฒเธเธเธฐเธงเธฑเธเธญเธญเธเนเธเธตเธขเธเนเธซเธเธทเธญ เธฃเธฐเธเธฑเธเธเธฃเธฐเนเธเธจ เนเธฅเธฐเธฃเธฐเธเธฑเธเธเธฒเธเธฒเธเธฒเธเธด&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">7. เธเธฒเธฃเธเธฑเธเนเธซเนเธกเธตเธเธตเนเธเธฑเนเธเธเธญเธเธชเธณเธเธฑเธเธเธฒเธเธเธตเนเธกเธตเนเธฅเธเธฒเธเธธเธเธฒเธฃ เนเธฅเธฐเธเธนเนเธเธฃเธฐเธชเธฒเธเธเธฒเธ (coordinator) เนเธเธทเนเธญเนเธเนเธเธเธตเนเธเธดเธเธเนเธญเธเธฃเธฐเธชเธฒเธเธเธฒเธเนเธฅเธฐเนเธเนเธเธจเธนเธเธขเนเธฃเธงเธก เธเธญเธเธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธเธเธญเธเนเธเธฃเธเธเธฒเธฃ เธฃเธงเธกเธเธถเธเธเธฒเธฃเธเธฑเธเนเธเนเธเธฃเธฒเธขเธฅเธฐเนเธญเธตเธขเธเธเธฒเธฃเธเธฑเธเธเธถเธเธเธญเธเธเธนเนเธเนเธงเธขเนเธเนเธฅเธฐเธฃเธฒเธข เธเธถเนเธเธเธฃเธฐเธเธญเธเธเนเธงเธขเธเธฒเธฃเธงเธฒเธเนเธเธ เธเธฒเธฃเนเธซเนเธเธฒเธฃเธเธนเนเธฅเธฃเธฑเธเธฉเธฒเธเธฒเธฃเธเธดเธเธเธฒเธกเธเธฒเธฃเธฃเธฑเธเธฉเธฒ เธเธฒเธเธเนเธญเธกเธนเธฅเนเธฅเธฐเธเธฃเธฐเธงเธฑเธเธดเธเธญเธเธเธฒเธฃเธฃเธฑเธเธฉเธฒเธเธญเธเธชเธฒเธเธฒเธเนเธฒเธเน เธฃเธงเธกเธเธถเธเธเธฑเธเธเธถเธเธญเธทเนเธเน เนเธเนเธ เธ�เธฒเธเธเนเธฒเธข เธ�เธฒเธเธฃเธฑเธเธชเธตเธงเธดเธเธดเธเธเธฑเธข เนเธเธเธเธณเธฅเธญเธเธเธฑเธเนเธฅเธฐเธเธฑเธเธเธถเธเธเธฒเธฃเธเธนเธ เนเธเนเธเธเนเธ เนเธเธขเธกเธตเธเธฒเธฃเธเธฑเธเธซเธฒเนเธซเธฅเนเธเธเธธเธเนเธฅเธฐเธเธฒเธฃเธเธฑเธเธเธฑเนเธเธเธญเธเธเธธเธเนเธเธทเนเธญเธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธฃเธญเธขเนเธฒเธเธเนเธญเนเธเธทเนเธญเธ&nbsp;</span></p>\r\n<p>\r\n	<br style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; " />\r\n	<u><strong><span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">เธเธฃเธฐเนเธขเธเธเนเธเธตเนเธเธฒเธเธงเนเธฒเธเธฐเนเธเนเธฃเธฑเธ</span></strong></u><br style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; " />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">1. เธเธฑเธเธเธฒเธเธฒเธฃเธเธทเนเธเธเธนเธชเธ�เธฒเธเธเธตเนเธเธตเธเธญเธเธเธนเนเธเนเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธงเธเธตเนเธกเธตเธ�เธฒเธงเธฐเธเธฒเธเนเธซเธงเนเธ เนเธเธเธฒเธเนเธซเธงเน เนเธฅเธฐเธเธงเธฒเธกเธเธดเธเธฒเธฃเนเธเนเธเธณเนเธเธดเธเธเธญเธเธจเธตเธฃเธฉเธฐเนเธฅเธฐเนเธเธซเธเนเธฒ&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">2. เธเธฑเธเธเธฒเธเธงเธฒเธกเธฃเธนเน เธเธงเธฒเธกเนเธเนเธฒเนเธเนเธเธญเธเธเนเธเธงเธฒเธกเธฃเธนเนเธเธฑเธเธเธธเธเธฑเธเธเธญเธเธเธนเนเธเนเธงเธขเธเธตเนเธกเธตเธ�เธฒเธงเธฐเธเธตเน เธเธฃเธฐเธขเธธเธเธเนเธญเธเธเนเธเธงเธฒเธกเธฃเธนเนเนเธซเธฅเนเธฒเธเธฑเนเธเนเธซเนเนเธเนเธฒเธเธฑเธเธชเธ�เธฒเธงเธฐเนเธงเธเธฅเนเธญเธกเธเธญเธเธเนเธญเธเธเธดเนเธ เนเธฅเธฐเธเธฃเธฐเธเธฒเธขเธญเธเธเนเธเธงเธฒเธกเธฃเธนเนเธเธตเนเนเธเนเธเธฑเนเธเนเธเธทเนเธญเธเธฒเธฃเธเธทเนเธเธเธนเธชเธ�เธฒเธเธเธญเธเธเธนเนเธเนเธงเธขเธเธตเนเธเธตเธขเธดเนเธเธเธถเนเธ</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">3. เธชเนเธเนเธชเธฃเธดเธกเธเธงเธฒเธกเธฃเนเธงเธกเธกเธทเธญเนเธเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเนเธฅเธฐเธชเธซเธชเธเธฒเธเธฑเธ เนเธเธทเนเธญเนเธซเนเนเธเธดเธเธเธฒเธฃเธเธฑเธเธเธฒเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธง เนเธเธขเธกเธตเธเธฒเธฃเธเธฃเธฐเธชเธฒเธเธเธฒเธเธเธตเนเธเธต เนเธฅเธฐเธเธฒเธฃเธเธณเธเธฒเธเนเธเนเธเธเธตเธกเนเธเธทเนเธญเธเธฒเธฃเธเธนเนเธฅเธชเธธเธเธ�เธฒเธ</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">4. เธเธฒเธฃเนเธเธดเนเธกเธเธธเธเธเนเธฒเธเธตเนเธเธตเนเธเธเนเธฒเธเธเธฒเธฃเธเธนเนเธฅเธฃเธฑเธเธฉเธฒเนเธฅเธฐเธเธทเนเธเธเธนเธชเธ�เธฒเธเธเนเธญเธเธนเนเธเนเธงเธขเธเธตเนเธกเธตเธ�เธฒเธงเธฐเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเนเนเธฅเธฐเธเธงเธฒเธกเธเธดเธเธฒเธฃเนเธเนเธเธณเนเธเธดเธเธเธญเธเธจเธตเธฃเธฉเธฐ เนเธฅเธฐเนเธเธซเธเนเธฒเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธง เธฃเธงเธกเธเธถเธเธเธนเนเธเธตเนเนเธเธตเนเธขเธงเธเนเธญเธเนเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฑเนเธเธซเธกเธ</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">5. เธกเธตเธเธฒเธฃเธเธฑเธเธเธฒเธฃเธฐเธเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเนเนเธเธเธญเธเธเนเธฃเธงเธกเนเธเธขเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเธฃเธงเธกเธเธถเธเธเธฒเธฃเธชเธฃเนเธฒเธเนเธเธฃเธทเธญเธเนเธฒเธขเธฃเธฐเธเธเธเธฒเธฃเธเธดเธเธเนเธญ เธเธฃเธฐเธชเธฒเธเธเธฒเธเธเธญเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเธเธฑเนเธเนเธเธฃเธฐเธเธฑเธเธเธฃเธฐเนเธเธจเนเธฅเธฐเธเธฒเธเธฒเธเธฒเธเธดเธเธตเนเธชเธญเธเธเธฅเนเธญเธเธเธฑเธเธเธงเธฒเธกเธเนเธญเธเธเธฒเธฃเธชเนเธงเธเธเธธเธเธเธฅ เธชเธ�เธฒเธงเธฐเธเธญเธเธเนเธญเธเธเธตเนเนเธจเธฃเธฉเธเธเธดเธ เธชเธฑเธเธเธกเธกเธตเนเธฅเธฐเธฃเธฐเธเธเธเธฒเธฃเธเธฃเธดเธเธฒเธฃเธชเธธเธเธ�เธฒเธ&nbsp;</span><br />\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">6. เนเธเธดเธเธเธฒเธฃเธงเธดเธเธฑเธขเธเธตเนเนเธเธตเนเธขเธงเธเนเธญเธเนเธฅเธฐเธเธณเนเธเนเธเนเธเธฃเธฐเนเธขเธเธเนเนเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเน เนเธฅเธฐเธเธฑเธเธเธฒเธฃเธฐเธเธเธเธฒเธฃเธเธฃเธดเธเธฒเธฃเธเธนเนเธเนเธงเธขเธเธตเนเธเธตเธเนเธญเนเธ</span></p>\r\n', '2012-10-15'),
(17, '', 'เธเธงเธฒเธกเนเธเนเธเธกเธฒ', '<center>\r\n	<p>\r\n		<font color="#000" size="3" style="font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; "><b>เธเธฃเธฐเธงเธฑเธเธดเธเธญเธเธจเธนเธเธขเนเธงเธดเธเธฑเธขเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเน</b></font></p>\r\n</center>\r\n<p>\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;เธ�เธฒเธงเธฐเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเนเนเธฅเธฐเธเธงเธฒเธกเธเธดเธเธฒเธฃเนเธเนเธเธณเนเธเธดเธเธเธญเธเธจเธตเธฃเธฉเธฐเนเธฅเธฐเนเธเธซเธเนเธฒเนเธเนเธเธเธงเธฒเธกเธเธดเธเธฒเธฃเนเธเนเธเธณเนเธเธดเธเธเธตเนเนเธเธตเนเธขเธงเธเนเธญเธเธเธฑเธ เธเธฑเธเธซเธฒเธซเธฅเธฒเธขเธเนเธฒเธ เนเธฅเธฐ เธกเธตเธเธงเธฒเธกเธเธฑเธเธเนเธญเธเธเธถเนเธเธกเธตเธเธฅเธเธฃเธฐเธเธเธเนเธญเธฃเนเธฒเธเธเธฒเธขเนเธฅเธฐเธเธดเธเนเธเธเธญเธเธเธนเนเธเนเธงเธขเธเธดเธเธฒเธกเธฒเธฃเธเธฒเนเธฅเธฐเธเธนเนเธเธเธเธฃเธญเธเธฃเธงเธกเธเธถเธเธเธฒเธฃเธชเธนเธเนเธชเธตเธขเธเธฒเธเนเธจเธฃเธฉเธเธเธดเธเธเธญเธเธเธฒเธเธดเนเธเธขเธเธงเธฒเธกเธเธดเธเธฒเธฃ เธเธฒเธเธฃเนเธฒเธเธเธฒเธขเธเธตเนเนเธซเนเธเนเธเนเธเธเธฑเธเธเธทเธญเธฃเธนเธเธฃเนเธฒเธเนเธฅเธฐเนเธเนเธฒเนเธเธฃเธเธเธญเธเนเธเธซเธเนเธฒเธเธฒเธฃเธเธนเธเนเธกเนเธเธฑเธเธ�เธฒเธงเธฐเนเธเธฃเธเธเนเธญเธเธซเธนเธเธฑเนเธเธเธฅเธฒเธเธญเธฑเธเนเธชเธเธเธฒเธฃเนเธเนเธขเธดเธเธฃเธฐเธเธเธเธฒเธฃเธเธฅเธทเธเธเธฑเธเธซเธฒเนเธเธตเนเธขเธงเธเธฑเธ เธเธฑเธเธเธฒเธฃเธชเธเธเธฑเธเธฃเธงเธกเธเธถเธเธเธฑเธเธเธฒเธเธฒเธฃเนเธฅเธฐเธเธฒเธฃเนเธเธฃเธดเธเนเธเธดเธเนเธเธเนเธฒเธเธฒเธเธเธฒเธฃเธจเธถเธเธฉเธฒเธเธตเนเธเนเธฒเธเธกเธฒเธเธเธญเธฑเธเธฃเธฒเธเธฒเธฃเนเธเธดเธเธญเธธเธเธฑเธเธดเธเธฒเธฃเธเนเนเธเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเน เนเธเธ�เธฒเธ เธเธฐเธงเธฑเธเธญเธญเธเนเธเธตเธขเธ