(19, '', 'เธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธ', '<p style="text-align: center; ">\r\n	<font size="3" style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; ">เนเธเธงเธเธฒเธเธเธฒเธฃเธเธณเนเธเธดเธเธเธดเธเธเธฃเธฃเธก</font></p>\r\n<p>\r\n	<span style="color: rgb(134, 134, 134); font-family: Tahoma, Verdana, Arial, Helvetica, sans-serif; font-size: small; ">1. เนเธเนเธเนเธเธฃเธเธเธฒเธฃเธเธงเธฒเธกเธฃเนเธงเธกเธกเธทเธญเธฃเธฐเธซเธงเนเธฒเธเธเธเธฐเนเธเธเธขเธจเธฒเธชเธเธฃเน เนเธฅเธฐเธเธเธฐเธเธฑเธเธเนเธเธเธขเธจเธฒเธชเธเธฃเน เธเธตเนเนเธเนเธฃเธฑเธเธเธฒเธฃเธชเธเธฑเธเธชเธเธธเธเธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธฃ เธเธฒเธเธกเธซเธฒเธงเธดเธเธขเธฒเธฅเธฑเธขเธเธญเธเนเธเนเธ เนเธฅเธฐเธกเธตเธเธฒเธฃเธซเธฒเนเธซเธฅเนเธเธเธธเธเธชเธเธฑเธเธชเธเธธเธเธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธฃเนเธเธดเนเธกเนเธเธดเธกเนเธเธทเนเธญเนเธซเนเธชเธฒเธกเธฒเธฃเธเธเธณเนเธเธดเธเธเธฒเธฃเนเธเนเนเธเธฃเธฐเธขเธฐเธขเธฒเธง<br />\r\n	2. เธเธฒเธฃเธชเธฃเนเธฒเธเธฃเธฐเธเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเนเธเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃ เนเธเธขเธกเธตเธเธนเนเธเธฃเธฐเธชเธฒเธเธเธฒเธ เธชเธฃเนเธฒเธเนเธเธงเธเธฒเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเนเธเธเธญเธเธเนเธฃเธงเธกเธเธตเนเธกเธธเนเธเนเธเนเธเธเธนเนเธเนเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธงเนเธเนเธเธจเธนเธเธขเนเธเธฅเธฒเธเนเธเธขเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเธเธตเนเธกเธตเธเธฒเธฃเธเธนเนเธฅเธญเธขเนเธฒเธเธเนเธญเนเธเธทเนเธญเธเนเธเนเธเธฃเธฐเธขเธฐเธขเธฒเธง เธเธฒเธฃเธเธฑเธเธเธฅเธดเธเธดเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธเนเธเธเธฒเธเนเธซเธงเนเนเธเธเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃเธญเธขเนเธฒเธเธชเธกเนเธณเนเธชเธกเธญ เนเธฅเธฐเธกเธตเธเธฒเธฃเธเธฃเธฐเนเธกเธดเธเธเธฅเธเธธเธเธ�เธฒเธเธเธญเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเนเธฒเธเธเนเธฒเธเนเนเธเธทเนเธญเธเธฒเธฃเธเธฑเธเธเธฒเธญเธขเนเธฒเธเธเนเธญเนเธเธทเนเธญเธ<br />\r\n	3. เธเธฒเธฃเธเธฑเธเธเธฒเธฃเธเธถเธเธญเธเธฃเธก เธเธฃเธฐเธเธธเธกเธงเธดเธเธฒเธเธฒเธฃ เธฃเธงเธกเธเธถเธเธเธฒเธฃเธเธฅเธดเธเนเธญเธเธชเธฒเธฃเธเธฒเธเธงเธดเธเธฒเธเธฒเธฃ เธเธณเธฃเธฒ เนเธฅเธฐเธเธฒเธเธงเธดเธเธฑเธข เนเธเธทเนเธญเนเธเนเธเธเธฒเธฃเนเธซเนเธเธงเธฒเธกเธฃเธนเนเนเธฅเธฐเนเธเธขเนเธเธฃเนเธเธฅเธเธฒเธเธเธญเธเธเธตเธกเธชเธซเธงเธดเธเธขเธฒเธเธฒเธฃ เนเธเนเธเธธเธเธฅเธฒเธเธฃเธเธฒเธเธเธฒเธฃเนเธเธเธขเน เนเธฅเธฐเธเธนเนเธเนเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธงเธญเธขเนเธฒเธเธเนเธญเนเธเธทเนเธญเธ<br />\r\n	4. เธเธฒเธฃเธงเธดเธเธฑเธข เธเธฑเธเนเธซเนเธกเธตเนเธเธฃเธเธเธฒเธฃเธงเธดเธเธฑเธขเธเธตเนเนเธเธตเนเธขเธงเธเนเธญเธเธเธฑเธเธเธฅเธธเนเธกเธเธนเนเธเนเธงเธขเธเธตเนเนเธเนเธเธเธฑเธเธซเธฒเธเธตเนเธเธฃเธฐเธเธเธเนเธญเธชเธฑเธเธเธก เนเธเนเธเธเธฃเธฐเนเธขเธเธเนเธเนเธญเธเธฒเธฃเธเธฑเธเธเธฒเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเนเธเธญเธเธฒเธเธ เนเธฅเธฐเธชเธฒเธกเธฒเธฃเธเธเธณเนเธเธชเธนเนเธเธฒเธฃเธงเธดเธเธฑเธขเธเธตเนเธกเธตเธกเธฒเธเธฃเธเธฒเธเธฃเธฐเธเธฑเธเธเธฒเธเธฒเธเธฒเธเธด<br />\r\n	5. เธเธฒเธฃเธเธฃเธดเธเธฒเธฃเธงเธดเธเธฒเธเธฒเธฃเนเธเนเธชเธฑเธเธเธก เนเธเธขเธเธฑเธเนเธซเนเธกเธตเนเธเธฃเธเธเธฒเธฃเธเธฃเธดเธเธฒเธฃเธงเธดเธเธฒเธเธฒเธฃ เนเธซเนเธเธงเธฒเธกเธฃเธนเนเธเนเธฒเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธ เนเธเธเธฒเธเนเธซเธงเน เนเธเนเธเธนเนเธเนเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธง เนเธฅเธฐเธเธฑเธเธเธณเนเธญเธเธชเธฒเธฃเธเธนเนเธกเธทเธญเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธ เนเธเธเธฒเธเนเธซเธงเน เธชเธณเธซเธฃเธฑเธเธเธนเนเธเนเธงเธขเนเธฅเธฐเธเธฃเธญเธเธเธฃเธฑเธง<br />\r\n	6. เนเธเนเธเธจเธนเธเธขเนเธเธฅเธฒเธเธเธญเธเธเธฒเธฃเธเธฃเธฐเธชเธฒเธเธเธฒเธเธเธฒเธฃเธเธนเนเธฅเธเธนเนเธเนเธงเธขเธเธฒเธเนเธซเธงเนเธ เนเธเธเธฒเธเนเธซเธงเน เธเธฑเนเธเนเธเนเธเธเธเธฑเธเธซเธงเธฑเธเธ�เธฒเธเธเธฐเธงเธฑเธเธญเธญเธเนเธเธตเธขเธเนเธซเธเธทเธญ เธฃเธฐเธเธฑเธเธเธฃเธฐเนเธเธจ เนเธฅเธฐเธฃเธฐเธเธฑเธเธเธฒเธเธฒเธเธฒเธเธด<br />\r\n	7. เธเธฒเธฃเธเธฑเธเนเธซเนเธกเธตเธเธตเนเธเธฑเนเธเธเธญเธเธชเธณเธเธฑเธเธเธฒเธเธเธตเนเธกเธตเนเธฅเธเธฒเธเธธเธเธฒเธฃ เนเธฅเธฐเธเธนเนเธเธฃเธฐเธชเธฒเธเธเธฒเธ (coordinator) เนเธเธทเนเธญเนเธเนเธเธเธตเนเธเธดเธเธเนเธญ เธเธฃเธฐเธชเธฒเธเธเธฒเธเนเธฅเธฐเนเธเนเธเธจเธนเธเธขเนเธฃเธงเธกเธเธญเธเธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธเธเธญเธเนเธเธฃเธเธเธฒเธฃ เธฃเธงเธกเธเธถเธเธเธฒเธฃเธเธฑเธเนเธเนเธเธฃเธฒเธขเธฅเธฐเนเธญเธตเธขเธเธเธฒเธฃเธเธฑเธเธเธถเธเธเธญเธเธเธนเนเธเนเธงเธขเนเธเนเธฅเธฐเธฃเธฒเธข เธเธถเนเธเธเธฃเธฐเธเธญเธเธเนเธงเธข เธเธฒเธฃเธงเธฒเธเนเธเธ เธเธฒเธฃเนเธซเนเธเธฒเธฃเธเธนเนเธฅเธฃเธฑเธเธฉเธฒ เธเธฒเธฃเธเธดเธเธเธฒเธกเธเธฒเธฃเธฃเธฑเธเธฉเธฒ เธเธฒเธเธเนเธญเธกเธนเธฅเนเธฅเธฐเธเธฃเธฐเธงเธฑเธเธดเธเธญเธเธเธฒเธฃเธฃเธฑเธเธฉเธฒเธเธญเธเธชเธฒเธเธฒเธเนเธฒเธเน เธฃเธงเธกเธเธถเธเธเธฑเธเธเธถเธเธญเธทเนเธเน เนเธเนเธ เธ�เธฒเธเธเนเธฒเธข เธ�เธฒเธเธฃเธฑเธเธชเธตเธงเธดเธเธดเธเธเธฑเธข เนเธเธเธเธณเธฅเธญเธเธเธฑเธ เนเธฅเธฐเธเธฑเธเธเธถเธเธเธฒเธฃเธเธนเธ เนเธเนเธเธเนเธ เนเธเธขเธกเธตเธเธฒเธฃเธเธฑเธเธซเธฒเนเธซเธฅเนเธเธเธธเธเนเธฅเธฐเธเธฒเธฃเธเธฑเธเธเธฑเนเธเธเธญเธเธเธธเธเนเธเธทเนเธญเธเธฒเธฃเธเธณเนเธเธดเธเธเธฒเธฃเธญเธขเนเธฒเธเธเนเธญเนเธเธทเนเธญเธ</span></p>\r\n', '2012-10-16'),
