(17, 0, 'เนเธฃเธเธเธขเธฒเธเธฒเธฅเธชเธกเนเธเนเธเธเธฃเธฐเธขเธธเธเธฃเธฒเธเธเธธเธเธดเธเธฒเธฃเธฒเธขเธเน เธ.เธเธฒเธฌเธชเธดเธเธเธธเน', '<p>\r\n	เธเธธเธเธญเธฑเธเธเธฃเธฒ เนเธเธขเนเธชเธเธฒ</p>\r\n<p>\r\n	เนเธเนเธฃเธฑเธเนเธญเธเธชเธฒเธฃเธงเธฑเธเธเธตเน 24 เนเธกเธฉเธฒเธขเธ 2556</p>\r\n<p>\r\n	เนเธญเธเนเธเธดเธเธงเธฑเธเธเธตเน 30 เนเธกเธฉเธฒเธขเธ 2556</p>\r\n', '2013-04-29'),
(18, 0, 'เนเธฃเธเธเธขเธฒเธเธฒเธฅเธชเธกเนเธเนเธ เธ.เธเธฒเธฌเธชเธดเธเธเธธเน', '<p>\r\n	เธเธธเธเธงเธฃเธเธธเธ เธเธธเธเธชเธญเธ</p>\r\n<p>\r\n	เนเธเนเธฃเธฑเธเนเธญเธเธชเธฒเธฃเธงเธฑเธเธเธตเน 10 เธเธคเธฉเธ�เธฒเธเธก 2556</p>\r\n<p>\r\n	เนเธญเธเนเธเธดเธเธงเธฑเธเธเธตเน 16 เธเธคเธฉเธ�เธฒเธเธก 2556</p>\r\n', '2013-05-10'),
