(20, 0, 'เนเธฃเธเธเธขเธฒเธเธฒเธฅเธเธฑเธเธเธฃเธงเธดเธเธฑเธข', '<p>\r\n	เธเธธเธเธญเธฃเธญเธธเธกเธฒ เธเธฃเนเธชเธเธชเธต</p>\r\n<p>\r\n	เนเธเนเธฃเธฑเธเนเธญเธเธชเธฒเธฃ เธงเธฑเธเธเธตเน 28 เธเธคเธฉเธ�เธฒเธเธก 2556</p>\r\n<p>\r\n	เนเธญเธเนเธเธดเธเนเธฅเนเธง</p>\r\n', '2013-06-26'),
(21, 0, 'เนเธฃเธเธเธขเธฒเธเธฒเธฅเธซเธเธญเธเธเธธเธเธจเธฃเธต', '<p>\r\n	เธเธธเธเธญเธธเธเธกเธเธฃ &nbsp;เนเธซเธกเธทเธญเธขเนเธเธชเธ</p>\r\n<p>\r\n	เนเธเนเธฃเธฑเธเนเธญเธเธชเธฒเธฃเธงเธฑเธเธเธตเน 5 เธกเธดเธเธธเธเธฒเธขเธ 2556</p>\r\n<p>\r\n	เนเธญเธเนเธเธดเธ 10 เธกเธดเธเธธเธเธฒเธขเธ 2556</p>\r\n', '2013-06-26'),
